import React from 'react';
import logo from './logo.svg';
import './App.css';
import WeightCalculator from "./features/user/WeightCalendar"

function App() {
  return (
    <div className="App">
      <WeightCalculator tileContent={({ date, view }) => view === 'month' && date.getDay() === 10 ? <p>It's Sunday!</p> : null}/>
    </div>
  );
}

export default App;
